import './Home.css';
import './components/nav';
import axios from "axios";
import { useEffect, useState } from 'react';

export default function Home() {
  const useAxios=function(url){
    const [name,setName]=useState("jsklaflks");
    useEffect(()=>{
     axios.get(url)
     .then((res) => {
       setName(res.data);
      console.log(name);
     });
     return {name};
    },[]);
  }

   const name=useAxios('http://localhost:8080/api/users');
  return (

    <div className="App">
     <nav name={name}/>
    </div>
  );
};
